import { Component } from "@angular/core";

@Component({
  selector: "app-tecnologies",
  templateUrl: "./tecnologies.component.html",
  styleUrls: ["./tecnologies.component.scss"],
})
export class TecnologiesComponent {
  tecnologies = [
    {
      title: "Lenguajes",
      items: [],
    },
    {
      title: "Frontend",
      items: [],
    },
    {
      title: "Backend",
      items: [],
    },
    {
      title: "DevOps",
      items: [],
    },
  ];
}
<div class="container">
  <div *ngFor="let item of tecnologies">
    <h1>{{ item.title }}</h1>
  </div>
</div>
